import React from "react";

const CourseRowComponent = ({ item }) => (
  <tr>
    <td>{item.name}</td>
    <td>{item.term}</td>
    <td>
        <button 
        onClick={() => deleteCourse(item)}
        className="btn btn-danger">Delete</button>

        <button className="btn btn-info">Edit</button>
    </td>
  </tr>
);

export default CourseRowComponent;
